===Etymology===
Named after the [[w:Yazoo River|Yazoo]] River, a tributary of the [[Mississippi]] with this characteristic.
===Noun===
{{en-noun}}
# {{lb|en|US}} A [[tributary]] that runs [[parallel]] to a [[river]] (especially when separated by a natural [[levee]]).
